import React from "react";
import styled from "styled-components";
import chef from "../images/smiling-chef.jpg";

function About() {
    return (
        <div className="about">
            This project is created to help users have an easier time finding recipes based on what they have in the fridge. In addition to the recipes, we have included a function to find restaurants around them.
            <img src={chef} id="smilingChef" alt="" style={{ width: 200, height: 200 }} />
        </div>
    );
}

const AboutStyle = styled.div`
    @font-face {
        font-family: 'Helvetica Black';
    }

    .smilingChef {
        display: block;
        margin-left: auto;
        margin-right: auto;
    }
`;

export default About;
